import React from 'react';
import { motion } from 'framer-motion';

const Skills = () => {
  const skills = ['HTML', 'CSS', 'JavaScript', 'React', 'Tailwind', 'Firebase', 'Python', 'Java'];

  return (
    <motion.section
      id="skills"
      className="text-white px-8 py-16"
      initial={{ opacity: 0, y: 50 }}
      whileInView={{ opacity: 1, y: 0 }}
      transition={{ duration: 0.8 }}
      viewport={{ once: true }}
    >
      <h2 className="text-3xl font-bold text-primary mb-4">Skills</h2>
      <div className="flex flex-wrap gap-4">
        {skills.map(skill => (
          <span key={skill} className="px-4 py-2 bg-gray-800 rounded-full text-sm">
            {skill}
          </span>
        ))}
      </div>
    </motion.section>
  );
};

export default Skills;
